import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        	<h3>Sawasdee Thai Cuisine</h3>
					<nav className>
						<ul>
							<li><a href="">Home</a></li>
							<li><a href="">Menu</a></li>
							<li><a href="">Order Online</a></li>
						</ul>
					</nav>

        </header>
      </div>
    );
  }
}

export default App;
